//SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.24;

import "@openzeppelin/contracts/token/ERC20/utils/SafeERC20.sol";

/**
 * @author Tushar Arora
 * @title A contract to allow people to stake coins and get rewards.
 * @dev uses SafeERC20
 */
contract StakingTokens
{
    using SafeERC20 for IERC20;
    IERC20 public immutable token;

    event Staked(address indexed user, uint amount);
    event Reward(address indexed user, uint amount);
    event Withdrawed(address indexed user);
    
    error InsufficientBalance(string message);
    error TimeNotCompleted(string message);

    //to Store data
    struct Stake 
    {
        uint256 amount;
        uint256 timestamp;
    }

    mapping(address => Stake) public stakers;

    constructor(IERC20 _token) 
    {
        token = _token;
    }

    /**
     * It allows a user to stake tokens but the amount can't be 0 and checks if they have sufficient balance to stake.
     * @dev Sets the value for {_amount}
     * @param _amount Value a user want to stake.
    */
    function stake(uint256 _amount) public
    {
        if(_amount <= 0)
            revert InsufficientBalance("Insufficient Balance");

        if(token.balanceOf(msg.sender) >= _amount)
            revert InsufficientBalance("You don't have enough balance");

        token.safeTransferFrom(msg.sender, address(this), _amount);

        stakers[msg.sender].amount += _amount;
        stakers[msg.sender].timestamp = block.timestamp;

        emit Staked(msg.sender, _amount);
    }

    /**
     * It allows user to withdraw only after 1 hour and also checks if they have non-zero balance in their account.
     * It will take out all the amount from their account.
     */
    function withdraw() public 
    {
        Stake memory user = stakers[msg.sender];
        if(user.amount < 0)
        {
            revert InsufficientBalance("No Tokens Staked");
        }
        if(block.timestamp <= user.timestamp + 1 hours)
            revert TimeNotCompleted("You can't withdraw before 1 hour");
        uint stakeTime = block.timestamp - user.timestamp;
        uint reward = user.amount * stakeTime / 3600;

        //this is how we will know that our contract have enough tokens to give rewards.
        require(token.balanceOf(address(this)) >= user.amount + reward, "Not Enough Money to give reward");

        // Transfer the staked tokens back to the user
        token.safeTransfer(msg.sender, user.amount + reward);


        //withdrawed
        stakers[msg.sender].amount = 0;
        stakers[msg.sender].timestamp = 0;

        emit Reward(msg.sender, reward);
        emit Withdrawed(msg.sender);
    }

    /**
     * @param amount The amount you want to fund this contract with, so that this contract can give rewards.
     * @custom:important This function should only be called by the person who desires to give his fund to this contract.
     */

    function fundRewards(uint amount) public
    {
        if(amount<=0)
            revert InsufficientBalance("You're supposed to enter a positive value");
            
        token.safeTransferFrom(msg.sender, address(this), amount);
    }

    /**
     * @param _user Address of the user inquiring about the remaining wait time before withdrawal.
     * 
     * It tells the user how much time left before he can withdraw his balance.
     */
    function timeUntilWithdrawable(address _user) public view returns (uint256)
    {
        Stake memory user = stakers[_user];

        if (block.timestamp >= user.timestamp + 1 hours)
            return 0;
        else
            return ((user.timestamp + 1 hours) - block.timestamp) / 60;
    }
}

